# üîå Prerequisites

1. Jira Plugin, Oboard web app, or Salesforce Plugin;

2. Access token from Oboard plugin.


# üîê Access token

1. Open Oboard app;

2. Go to Settings/Integrations/API Tokens;

3. Select create token;

4. Enter token name;

5. Select create;

6. Copy token and paste to 'API-Token' header parameter when call API.


# üîó Base URL

### Cloud Plugin / Web app / Salesforce Plugin

[https://backend.okr-api.com/api](https://backend.okr-api.com/api/)

### Server Plugin

https://{you-jira-instance}/rest/oboard/1.0/api  
example: [https://jira.example.com/rest/oboard/1.0/api](https://jira.example.com/api/v1/)

> Note: The rate limit is 5 requests per sec per organisation. 


# üßë‚ÄçüöÄ Support

Contact us [support@oboard.io](https://support@oboard.io) if you have any questions or propositions.

